import React from "react";
import styled from "styled-components";

import ButtonShell from "./SideMenuButton";
import D20Icon from "../Images/Dice/D20Icon";
import DragonIcon from "../Images/DragonIcon";

const Button = styled.div`
  &:hover {
    cursor: pointer;
  }
`;

const ButtonOutline = styled(ButtonShell)`
  top: 55vh;
`;

const DiceIcon = styled(DragonIcon)`
  width: 47px;
  position: fixed;
  left: 32px;
  top: 55.5vh;
`;

class CharacterMenu extends React.Component {
  render() {
    return (
      <Button>
        <ButtonOutline />
        <DiceIcon />
      </Button>
    );
  }
}

export default CharacterMenu;
